{
  "advertisements": [
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "ntokens": 30,
      "text": "1. Es fucht jemand einen feinen Schreibzeugt mit aller Zugehoerdt und schoener Fasson, der Liebhaber ist im Berichthaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "ntokens": 35,
      "text": "2. Man begehrt eine Chaise mit 4 Raedern, u. 2 Blaetzen und 2 Pfedern samt gehoerigem Geschirre, der Liebhaber ist im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "ntokens": 40,
      "text": "3. Wer hier ober auf dem Land noch neuen Traeber zu verkaufen hat, kann im Berichthaus einen Kaeufer dazu vernehmen, wie auch zu einem mittelmaessigen Sponten, so ebenfalls begehrt wird, beyde ohne Entgeldt im Berichthaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "ntokens": 30,
      "text": "4. Es fucht jemand eine alte, solide und ungefehr einen Saum haltende Feuerspritzen zum tragen ober zum fahren, der Liebhaber ist im Berichthaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "ntokens": 30,
      "text": "5. Es fucht jemand einen moeglichen Kronenleuchter mit 8 Lichtstoeken, der Liebhaber ist im Berichthaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "ntokens": 25,
      "text": "6. Es verlangt jemand eine nicht gar grosse eiserne Geldt-Cassa zu kaufen, der Liebhaber ist im Berichthaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "ntokens": 25,
      "text": "7. Es verlangt jemand einen glatten nuessbaeumern zweyfuehrigen Kasten, der Liebhaber ist im Berichthaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt",
      "ntokens": 35,
      "text": "8. Man verlangt einen noch guten Racheldofer mittelmaessiger Groesse mit oder ohne Fuss, der Liebhaber ist im Berichthaus zu erfragen; leihet aber keinen Verzug."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert",
      "ntokens": 30,
      "text": "1. Ein Localment mitten im Offenburgers Hof, wie der Augen schein zeigen wird, auf naechste Faeschnacht, oder Pfingst-Fronfasten zu beziehen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert",
      "ntokens": 35,
      "text": "2. Ein fauberes Localment an der Spalen von einem Stuben und Nebenkammer, oder nach Belieben zwey Kammern mit einem beitragen Sommerhaus, alles auf einen Boden und nach Belieben Stallung und Heubodne, auf Pfingst-Fronfasten zu beziehen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert",
      "ntokens": 30,
      "text": "3. Ein Localment mit einem schoenen Laden und Laden-Stueblein nebst einem grossen Sommershaus, Stuben, Kuechlin, 2 grosse Kammern, einem bequemen Keller, Holzstadel, ein beschloessenes Bauchhaus, auf der Eisengaess, im Besrichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert",
      "ntokens": 30,
      "text": "4. Ein Localment in der Froeschgaess von einer Stuben, 2 Kammern und Platz zum Hof, auf den Pfingst-Fronfasten zu beziehen, im Berichthaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert",
      "ntokens": 35,
      "text": "5. Ein Localment fuers 2 Personen in der Weissengass, bestehend aus einem Stueblein und Mezzanin, Platz zum Hausrath zu stellen, auf einem Boden, wie auch Platz zum Hof, Brunnnen un Haus, a 150 Pfund Juns des Jahres, kann gleich bezogen werden, im Berichthaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert",
      "ntokens": 35,
      "text": "6. Ein schoenes Localment ebenes Fuesses auf einen Boden von 3 Stuben, einen grossen Saal, Kammern, Kuechlin, Keller, Platz zum Hof, Zutritt zum Bauchhaus, und, so beliebig, einen Garten in der Nebenhaeuser Vorstadt, im Berichthaus ohne Entgeldt zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert",
      "ntokens": 20,
      "text": "7. Eine grosse doppelte Frucht-Schuette auf dem E. E. Gesellschafft zum Hohen Rupf."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert",
      "ntokens": 30,
      "text": "8. Bis den 1sten diess wird eine saubere Huendin begehrt, um etliche junge Hunde zu auserlesen, gegen einer Erkaennlichkeit; zwei sich anzu melden, ist im Berichthaus ohne Entgeldt zu vernehmen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert",
      "ntokens": 30,
      "text": "9. Auf kuenftige Weinmacht ist unter der St. Peter-Schul ein geraeumiges Magazin zu verleihen, darum sich in dem Schulhaus anzumelden."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hoff, Information und Bedienungen werden angetragen und begehrt",
      "ntokens": 30,
      "text": "1. In ein wackeres protestantisches Haus in denen Niederlanden wird ein Candidatus Theologiae, der neben andern auch die franzoesische Sprach weisshande, zu einem Haus-Praeceptor begehrt, im Berichthaus zu melden."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hoff, Information und Bedienungen werden angetragen und begehrt",
      "ntokens": 25,
      "text": "2. Man verlangt einen Menschen in eine Fabrique, der sich zu allerley Haus-Geschaefte brauchen laesst, im Berichthaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hoff, Information und Bedienungen werden angetragen und begehrt",
      "ntokens": 20,
      "text": "3. Man sucht einen Stallknecht in ein Wirths-Haus, im Berichthaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hoff, Information und Bedienungen werden angetragen und begehrt",
      "ntokens": 5,
      "text": "4. Eins"
    }
  ]
}
